function App() {
  return (

  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Navbar />}>
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<Signup />} />
      </Route>
    </Routes>
  </BrowserRouter>      
  );
}

export default App;
